import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import { render } from '@testing-library/react';

class App extends Component{
  render(){
  return (
    <div className="App">
      Hello world
      <FirstComponent />
    </div>
  );
}
}

class FirstComponent extends Component{
  render(){
  return (
    <div className="firstComponent">
      First Component
    </div>
  );
}
}

export default App;
